import React, { useState } from 'react';

export default function App() {
  const questions = [
    {
      questionText: 'When traveling, what type of restaurants do you like the best?',
      answerOptions: [
        { answerText: 'Have preparations done right from the start', isPoint: '1.0' },
        { answerText: 'Have snacks carried along with you', isPoint: '0.4' },
        { answerText: '', isPoint: '' },
        { answerText: '', isPoint: '' },
      ]
    }
  ]
}
